Nu we weten hoe je een bericht in de console kan zetten gaan we kijken naar de verschillende data types die je kan gebruiken in JavaScript. Dit gaan we doen door ze te laten zien in de console. Zet de volgende berichten in de console: "Hallo Wereld" 42 true null undefined Je code ziet er nu ongeveer zo uit: console.log("Hallo Wereld");
console.log(42);
console.log(true);
console.log(null);
console.log(undefined); Laten we voordat we de console openen kijken naar null en undefined. Deze twee data types lijken op elkaar, maar zijn niet hetzelfde. null betekent dat er geen waarde is. undefined betekent dat er geen waarde is toegewezen. Als je nu de console opent in de browser zie je de waardes van verschillende data types staan. Om nu de data types te kunnen zien moeten we iets toevoegen aan de code. Zet voor elke waarde de functie typeof: console.log(typeof "Hallo Wereld");
console.log(typeof 42);
console.log(typeof true);
console.log(typeof null);
console.log(typeof undefined); Als we nu de console openen in de browser zien we de verschillende data types staan. Console Heb je gemerkt dat null object geeft als data type? Dit is een fout in JavaScript die niet meer kan worden opgelost, omdat het te veel code zou breken. Als je hier meer over wilt weten kan je er hier meer over lezen.
